script: |
  super -f text -I q5650.spq | sort > q5650.out

inputs:
  - name: q5650.spq
    data: |
      SELECT DISTINCT + col1 / + 97 * - 68 AS col0 FROM tab1 (FORMAT parquet) WHERE 6 * + col2 + + col2 * - col1 <= + + col0 * + col2 + col0;
  - name: tab1

outputs:
  - name: q5650.out
    data: |
      0
